INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", "フリーマーケット会場", 10118, 5118061, 2834, 7, "青空の下で謁見", 8, 2, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", "フリーマーケット会場", 10118, 5118062, 2835, 7, "未来の騎空団\nマスコット？", 8, 2, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", "ランドソル市街地", 10118, 5118063, 2837, 7, "お嬢さまからの\n緊急依頼", 8, 2, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", "フリーマーケット会場", 10118, 5118064, 4108402, 18, "黄金色の悩みごと", 8, 2, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", "フリーマーケット会場", 10118, 5118065, 4107402, 18, "白熱！　格闘大会！", 8, 2, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", "オーエド町", 10118, 5118066, 9000227, 16, "祭り太鼓はオーエドの華", 8, 2, 20063115, 1, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", "フリーマーケット会場", 10118, 5118067, 2101181, 19, "人気者は遅れて\nやってくる", 8, 3, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", "ランドソル市街地", 10118, 5118068, 4109402, 18, "巫女・ミーツ・魔法少女", 8, 3, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", "フリーマーケット会場", 10118, 5118069, 4305402, 18, "ネズ耳は二度なくなる", 8, 3, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", "ランドソル市街地", 10118, 5118070, 4101402, 18, "この出会いにカンパイ！", 8, 3, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", "ランドソル市街地", 10118, 5118071, 4106402, 18, "陰陽アンサンブル", 8, 3, 20063115, 0, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (40, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", "フリーマーケット会場", 10118, 5118072, 2836, 7, "運試し十番勝負！", 8, 3, 20063115, 1, 1, 91002);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (0, 0, "オープニング", 0, 10118, 5118600, 0, 0, "彼女たちの新たな日常", 0, 1, 20063115, 0, 0, 0);
